import 'dart:convert';

import 'package:billDeskSDK/sdk.dart';
import 'package:flutter/material.dart';
import 'package:http/http.dart' as http;
import 'package:get/get.dart';
import 'package:shared_preferences/shared_preferences.dart';
import 'package:study_evaluation/utils/app_constants.dart';
import 'package:study_evaluation/utils/app_utils.dart';
import 'package:study_evaluation/utils/function_lib.dart';
import 'package:study_evaluation/view/views/success_view.dart';

class SDKLauncher {
  BuildContext? context;
  static String? id;

  static String? payload;

  Future<dynamic> createOrder(String url, BuildContext context) async {
    final response = await http.get(Uri.parse(url));
    // ignore: use_build_context_synchronously
    Navigator.pop(context);
    if (response.statusCode == 200) {
      // print("response.statusCode ${response.statusCode}");

      Map<String, dynamic> orderResponse = jsonDecode(response.body);
      AppUtils.currentContext = context;

      //debug('orderResponse $orderResponse');
      //  debug('orderResponse $orderResponse');

      payload = orderResponse['payload'];

      final flowConfigMap = {
        "merchantId": orderResponse['response']['mercid'].toString(),
        "bdOrderId": orderResponse['response']['bdorderid'].toString(),
        "authToken": orderResponse['response']['links'][1]['headers']
                ['authorization']
            .toString(),
        "childWindow": true,
        "retryCount": 2,
        "returnUrl": "",
      };

      final SdkConfigMap = {
        "flowConfig": flowConfigMap,
        "flowType": "payments",
        "merchantLogo":
            'data:image/png;base64,'
      };

      ResponseHandler responseHandler = SdkResponseHandler();

      final sdkConfig = SdkConfig(
          sdkConfigJson: SdkConfiguration.fromJson(SdkConfigMap),
          responseHandler: responseHandler,
          isUATEnv: false,
          isDevModeAllowed: true,
          isJailBreakAllowed: false);

      Get.to(() => SDKWebView(), arguments: sdkConfig);
    } else {
      throw Exception('Failed to load album');
    }
  }

  void printWrapped(String text) {
    final pattern = RegExp('.{1,800}'); // 800 is the size of each chunk
    pattern.allMatches(text).forEach((match) => print(match.group(0)));
  }

  Function? launchWebView(
      String url, BuildContext context, String? packageLineItemId) {
    this.context = context;

    id = packageLineItemId;

    //debug("packageLineItemId id ${id}");

    createOrder(url, context);
    return null;
  }
}

class SdkResponseHandler implements ResponseHandler {
  SDKLauncher sdkObj = SDKLauncher();

  void onTransactionResponse(TxnInfo txtInfo) {
    // debug("txtInfo@@@@ $txtInfo");
    if (txtInfo.txnInfoMap['isCancelledByUser'] == false) {
      // debug("packageLineItemId@# ${SDKLauncher.id}");
      buyPackage(txtInfo, SDKLauncher.id, SDKLauncher.payload);
    }
  }

  void onError(SdkError sdkError) {
    // print('#PAYMENT_GATEWAY_ERROR: $sdkError');
  }
}

void buyPackage(
    TxnInfo txtInfo, String? packageLineItemId, String? payload) async {
  BuildContext? context = AppUtils.currentContext;

  SharedPreferences prefs = await SharedPreferences.getInstance();
  var token = prefs.getString(SharedPrefsConstants.accessTokenKey);
  var body = jsonEncode({
    "access_token": "$token",
    "orderId": "${txtInfo.txnInfoMap['orderId']}",
    "payload": "${payload}"
  });

  // debug("body  ${body}");

  var response = await http.post(
      Uri.parse('https://studyevaluation.com/retrieveTransaction'),
      body: body);
  var jsonDecodeobj = jsonDecode(response.body);
  // debug("jsonDecodeobj  ${jsonDecodeobj}");

  if (response.statusCode.toString() == '200') {
    // debug("packageLineItemId  ${packageLineItemId}");
    // debug("packageLineItemId  ${response.statusCode}");

    Navigator.push(
      context!,
      MaterialPageRoute(
          builder: (context) => SuccessView(
              success: jsonDecodeobj['status'],
              packageLineItemId: packageLineItemId)),
    );
  }
  //debugPrint('response.body @@@  ${response.body}');

  void printWrapped(String text) {
    final pattern = RegExp('.{1,10000}'); // 800 is the size of each chunk
    pattern.allMatches(text).forEach((match) => print(match.group(0)));
  }
}
